var _story_ = {
    "1403": [
        {
            "_id": 1,
            "Story": "From that holy land blessed by the tripartite prophecy, the messenger split into a thousand forms, embarking on a long journey.<br>Tribios, Holy Maiden of Janusopolis, the Chrysos Heir who stole Passage's Coreflame, toiled for the masses and brought the news of deliverance to all domains.<br>Seek the children of humanity with golden blood in their veins, shatter the dimmest dark in this world, and walk toward the tomorrow where the stars gleam."
        },
        {
            "_id": 2,
            "Story": "<i>\"Date:  / <br>It's been ten years since <b>we</b> fled Janusopolis.<br>In those ten years, <b>we</b> measured the earth with our steps, unknowingly covering every corner of Amphoreus.<br><br>The spread of the black tide has been far worse than expected. From west to east, from south to north, even cities high in the sky have not been spared... <b>We</b> watched as tiny nations were consumed overnight by the growing black tide, turning all life into its fuel, surging forward with even greater force... The once-glorious past of Amphoreus is gone, replaced by overwhelming decay, raging Titans, fallen heroes, and displaced people.<br><br>But those consumed by the Strife fail to see.<br><br>The black tide has drawn near the inland cities. These cities are rich and well-connected, thriving on trade, but some dismissed <b>our</b> prophecy as nonsense and saw <b>us</b> as mere priests of bad omens, with no one listening, no one caring... If it takes shedding blood to unite the people, why not let it start with <b>us</b>?<br><br>Tri, I know you went to the front lines to send word of the black tide's advance, only to be struck down by the arrows of Black Tide Creatures.<br>Tri, I know you helped the refugees escape, only to be despised by the nobility and left to die by an assassin's dagger.<br>Tri, I know you escorted lost children, so close to safety. Your bright braids are now soaked in blood, and <b>we</b> can no longer braid or care for them.<br><br>With the fall of one city after another, the people are beginning to look beyond their endless conflicts and see the world on the brink of collapse.<br><br>The blood of the innocent will not be shed in vain. We've walked the first steps through thorns, hoping those who follow us will go farther than <b>we</b> ever could...\"</i><br><br><align=\"right\">  An ancient diary entry</align><br><align=\"right\">The paper as thin as a cicada's wings, left in the arms of a doll by Trianne</align>"
        },
        {
            "_id": 3,
            "Story": "<i>\"Date:  / <br>'Holy Maiden, we are ready to listen. Guide us through these end times and pray for our victory in battle,' said the kings.<br><br>The kings restored the identity of the Holy Maiden of Janus to <b>us</b>, placed <b>us</b> on an altar, dressed <b>us</b> in silk, and concealed <b>our</b> faces with ceremony.<br>Yet, <b>we</b> did not return to the city but lived in the castle. <b>We</b> wished to pray for the sick farmers and wandering warriors, to ease the sorrow of the grieving, to guide the lost, to bless the newly-weds, and to watch them sing around the bonfire.<br><br>Yet, just as it was in Janusopolis, the kings were unwilling to see <b>us</b> mingle with the people...<br><br>Mother, at this moment, <b>we</b> truly understand your helplessness and despair back then. <b>We</b> once believed that the prophecy would compel the kings to set aside their grievances and unite in search of the Chrysos Heirs, offering a glimmer of hope for salvation. Yet, they fear those with golden blood might strip them of their power. What they desire are wars waged in the name of prophecy. The hard-earned trust and the expectant gazes of the people are gradually being eroded.<br>The Coreflame of Janus burns ever hotter, and the golden prophecy continues to scrutinize <b>us</b>, urging <b>us</b> onward.<br><br><b>We</b> decided to flee.<br><br>Tri and Trianne opened the Century Gate, planning to meet in the dense forest, but encountered a rain of poisoned arrows. Trianne dodged a disaster but was unfortunately taken hostage by soldiers, becoming increasingly distant from <b>us</b>.<br>Tri chose to charge at the enemy's spear, clinging to the soldier who tried to withdraw his weapon, but <b>we</b> underestimated the king's cruelty. Even in death, <b>we</b> could not be claimed by other city-states.<br>...<br>The pain inflicted was many times greater than usual. This spring, most of <b>us</b> remain forever in the wilds where flowers have yet to bloom.<br><br>Goodbye, Tri. <br>Goodbye, Tri. <br>Goodbye, Tri. <br>...<br>Trianne, <b>we</b> are not yet ready to say goodbye to you. Please be sure to find <b>us</b> again...<br><br>Tonight, <b>we</b> will be able to cross this wilderness.\"</i><br><br><align=\"right\">  A diary entry kept by Trinnon</align><br><align=\"right\">Illustrated with a meteor crossing the sky</align>"
        },
        {
            "_id": 4,
            "Story": "<i>\"Date:  / <br>The first time we met Agy, she told us she was fond of the name Tribios, praising it as noble and beautiful, much like the garments she crafted. We asked if that was her sole reason for keeping us around. She shook her head, explaining she mainly wanted to hear this teacher's nightly tales.<br><br>Agy was also just a girl back then, afraid of the dark and ghosts. Remembering how her cravings led us on stealthy trips to the kitchen for leftover bread at night always brings a smile to our faces. Time is a sculptor, and having shaped Cerydra and Hysilens, now it has rendered Agy beautifully.<br><br>Agy never lets anyone down, just as we've always taught her. Her golden threads weave a dense net, ensnaring any foe that dares come close to her fingertips.<br><br>Yet the Cleaners who dwell in the shadows ambushed our team on the return journey. The assassins loyal to the Council of Elders would never allow the growth of Chrysos Heir who could lead the holy city of Okhema. We are no different. We, too, would rather sacrifice ourselves rather than stand by and look on as the young heroes' lives were cut short <br><br>We managed to escape the ordeal using the Century Gate, though our consciousness grew hazy by one more portion... After the last passage through the Century Gate, I feared we'd never find Trinnon and Tribbie again...<br><br>Don't worry, Agy. It's not our time yet. We just need a brief rest, and we'll be back on our feet...<br>But we must hasten our steps now...\"</i><br><br><align=\"right\">  A diary with weaker and weaker handwriting</align><br><align=\"right\">Reminisced by Trianne, recorded by Trinnon, and finalized by Tribbie</align>"
        },
        {
            "_id": 5,
            "Story": "<i>\"Date:  / <br>The dreams are fading...Hyacine said it's because there's less and less we can remember.<br>But today, <b>we</b> dreamed of countless paths stretching into the darkness. The sky was pitch black, and we kept running and running, but no matter how far we went, we couldn't find a way out...<br><br>'Don't be afraid. The brvae is here!' The supremely mighty Snowy descended from the sky, driving away the monsters for us.<br>'Teacher, fly forward!' The tiny purple Cas flapped her wings, blowing away the stones ahead.<br>'Bang Bang!' The strong gray raccoon struck with great force!<br>'Hmph' The red lion devoured the villains!<br><br>Our reliable new companions! They took the torches from those who came before, each one lighting up the darkness in turn.<br>But the torchlight in our hands is dying down  we need to hurry forward!<br><br> With this thought, our bodies began to grow, becoming so big that we could touch the sky without even lifting our hands. Our toes sank into the vast blue sea, while green leaves sporuted from our fingertips. Trianne's voice became the sound of rushing wind, carrying distant sands, and Trinnon rested upon soft, snow-capped mountains, ears filled with the lullaby of wind and rain.<br><br>And so we walked and walked, and soon there was only one path left before us <br>Ahead, the sky turned rosy, the ground silver-white. The west wind blew, and the fields were in full bloom. Wait... this place feels familiar. Is this Amphoreus? The roadside springs tasted of hoeny and milk, and the trees were heavy with endless fruit. As we walked on, the moon and stars climbed the sky  that was Tri gliding among them! Ahead of us was also Tri, Tri, Tri... It turns out everyone was waiting for us at the destination!<br><br>Look, there in the distance, Mother is greeting us! She's waving, smiling at us!<br><br>Shall we go?<br>Hmm, one day we will come!<br>But our journey isn't over yet!<br>So, see you tomorrow?<br>We will meet 'tomorrow'!<br>Yes, see you tomorrow.\"</i><br><align=\"right\"> A diary filled with crooked handwriting and misspellings</align>"
        }
    ]
}

